@NOS The closer to the end product you are, the more you'll make for less work unfortunately. The end product is bought by a consumer who's willing to pay more for quality and brand recognition. 

Companies want the cheapest thing humanely imaginable that works. And will ruthlessly switch suppliers to get the cheapest possible product. Most of the time one or two companies end up the winners. 

The fact that your buyers only want the cheapest product imaginable, and that demand for workers is kept low since there's only a couple of companies left in the business. It means less demand for workers and lower pay... It's really unfortunate because it's such a difficult field.

